import axios from 'axios'
import React, {useEffect, useState} from 'react'


function ProductosDisponibles(){

    const[dataproductos, setdataproductos]=useState([])

    
    useEffect(() => {

        axios.get('api/producto/obtenerproducto').then(res => {
            console.log(res.data)
            setdataproductos(res.data)
        }).catch(err => {
            console.log(err)
        })
       
    },[])

    //const listaproductos = dataproductos.filter(productos => productos.cantidad < 1).map(listaproductos)
    const listaproductos = dataproductos.map(dataproductos.filter(productos => productos.cantidad < 1))
    return(
        <div>&nbsp;
            <h2>Lista de Prodcutos Disponibles</h2>
            &nbsp;
            <div className='container'>
            <div className='row'>

                <div className='col-sm-6 offset-3' data-aos="flip-right">

                    <ul className='list-group'>
                        <li className='list-group-item'>Id: {dataproductos.idproducto}</li>
                        <li className='list-group-item'>Nombre: {dataproductos.nombre}</li>
                        <li className='list-group-item'>Precio: {listaproductos.precio}</li>
                        <li className='list-group-item'>Detalle: {listaproductos.detalle}</li>
                        <li className='list-group-item'>Cantidad: {listaproductos.cantidad}</li>
                    </ul>
                    &nbsp;
                    <hr className='mt-4'/>

                </div>


            </div>
            
        </div>
           
           
        </div>
    )
}
export default ProductosDisponibles
